const BASE_URL = 'localhost:3000'

export const createUser = async (username, password) => {
const result = fetch(`${BASE_URL}/users`, {
    method: 'POST',
    headers: {
        'Content-Type': 'application/json'
    },
    body: JSON.stringify({
    username, password
    })
})
}
